import { useEffect } from 'react';
import axios from 'axios';
import { API_KEY, baseURL, endPoints } from './data/api/movie';

function App() {
  useEffect(() => {
    axios.get(`${baseURL}${endPoints.originals}`, {
      params: { api_key: API_KEY },
    }).then(console.log).catch(console.error);
  }, []);

  return (<div />);
}

export default App;
